import "./Item.css"
const Item = ({ title, image, descripcion, price }) => {
    return (
      <>
        <h1>{title}</h1>
        <img className="imagenes" src={image} alt="camiseta Real Madrid" />
        <h2>{descripcion}</h2>
        <h2>${price}</h2>
      </>
    );
  };
  export default Item;
